    ProzDispatchboardComponent.prototype.getMajorTime = function (value) {
        var hours = new Date(value.date).toLocaleTimeString('en-US', { hour: 'numeric', hour12: true });
        return hours;
    };
    /**
     * @string == 08:00 PM
     */
    ProzDispatchboardComponent.prototype.getTime = function (string) {
        var time = {};
        time['hours'] = +string.split(":")[0];
        time['minutes'] = +string.split(":")[1].split(" ")[0];
        if (string.split(" ")[1] == "PM") {
            time['hours'] += 12;
        }
        return time;
    };
