    ProzDispatchboardComponent.prototype.sort = function (field) {
        var type = '';
        if (this.sortField != field) {
            type = 'asc';
        }
        else if (this.sortField == field && this.sortType == '') {
            type = 'asc';
        }
        else if (this.sortField == field && this.sortType == 'asc') {
            type = 'dsc';
        }
        else if (this.sortField == field && this.sortType == 'dsc') {
            type = '';
        }
        if (type == '') {
            this.bill = this.listCancelledWo;
        }
        else {
            console.log("gggggggggggggggggg", this.bill);
            this.bill = this.listCancelledWo.sort(function (x, y) {
                if (type == 'asc') {
                    if (field == "fieldworkOrderNumber")
                        return x[field].replace(/[a-zA-Z-]/g, '') - y[field].replace(/[a-zA-Z-]/g, '');
                    if (x[field] < y[field])
                        return -1;
                }
                if (type == 'dsc') {
                    if (field == "fieldworkOrderNumber")
                        return y[field].replace(/[a-zA-Z-]/g, '') - x[field].replace(/[a-zA-Z-]/g, '');
                    if (x[field] > y[field])
                        return -1;
                }
            });
        }
        this.sortType = type;
        this.sortField = field;
        console.log("type:" + type, "field" + field);
    };
